      body: "It seems connection is successfully. But in the [`config/fedml_config.yaml`](https://github.com/FedML-AI/FedML/blob/master/python/app/fedcv/object_detection/config/fedml_config.yaml),\
        \ the `client_num_per_round` is `2`. You can change it to `1` or you can launch\
        \ two clients using `bash run_client.sh 1` and `bash run_client.sh 2`.\r\n\
        \r\nBy the way, you can get more advantage usage at [here](https://github.com/FedML-AI/FedML/tree/master/python/app/fedcv/README.md)"
